text:
@jakeshieldsajj Very sorry to hear that. Many people I know have been severely assaulted.

Violent crime in SF is horrific and even if attackers are caught, they are often released immediately.

Is the city taking stronger action to incarcerate repeat violent offenders @BrookeJenkinsSF?

@TitterDaily Avoiding dystopian outcomes is not easy. 

The intent is not for the algorithm to be some judgy moral arbiter, but rather that it do its best to inform &amp; entertain.

Trying to maximize unregretted user-minutes seems like the right objective.
